&lt;p&gt;
	&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;First of all, I apologise for any inconvenience during your visit to Alfajar food premises. I am sending you all required documents for your kind considerations, could you please review these documents and reconsider your decision about Alfajar food hygiene rating.&lt;/span&gt;&lt;/p&gt;
&lt;p&gt;
	&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 10pt;&quot;&gt;Due to unexpected visit the files were not ready, some documents were in different files. I am sending you all temp records we hold and have conscious about control over meat section and regular inspecting butcher section and cold rooms. I shall be thankful to you for your reconsideration. If you need any further information regarding this matter, I will be much happier to provide it to you.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;
&lt;p style=&quot;margin: 4pt 0cm 2pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;
	&lt;span style=&quot;font-size:11.5pt;font-family:&amp;quot;Arial&amp;quot;,sans-serif&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;

&lt;p&gt;
	The following improvements have been conducted.&lt;/p&gt;
&lt;p&gt;
	The establishment has been throughly cleaned, and procedures are in place to ensure the cleanliness is maintained.&lt;/p&gt;
&lt;p&gt;
	The establishment has been or will shortly be renovated.&lt;/p&gt;
&lt;p&gt;
	A new management system has been implemented.&lt;/p&gt;
&lt;p&gt;
	The staff have been trained, retrained/given instruction/ are under revised supervisory arrangements.&lt;/p&gt;
&lt;p&gt;
	We now have new equipment and well-trained staff.&lt;/p&gt;
&lt;p&gt;
	We have ordered new uniforms.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;

&lt;p&gt;
	The conditions observed during the inspection were not typical of the high standards we maintain at &lt;strong&gt;KikiLicks AfroCarr Street Food&lt;/strong&gt;. At the time, our system for recording hot and cold food temperatures was not fully implemented, resulting in insufficient documentation. However, I believe the rating given was lower than deserved, as we fully met all other criteria regarding cleanliness, food safety, and hygiene practices.&lt;/p&gt;
&lt;p&gt;
	Since the inspection, we have implemented a robust system to consistently record temperatures for both hot and cold foods during preparation, storage, and serving, ensuring full compliance with food safety regulations.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;

&lt;p&gt;
	As you have advisied.&amp;nbsp; I am now using Safer Food Better Business for Caterers to log in daily inspections and temperatures. Allergen contents are now on display. Allergen stickers are put on food containers. Thermometer probe is calibrated monthly.&amp;nbsp;&lt;/p&gt;
&lt;p&gt;
	The kitchen is a shared community kitchen and our handwash was stolen. We are now storing all cleaning equipment in our locker including the handwash.&lt;/p&gt;
&lt;p&gt;
